   body{font-family:txjs, helvetica, arial;color:#151515;font-weight:400;overflow-x:hidden;padding:20px 0}
h1,h2,h3{text-align:center;margin:10px}
h2{font-size:60px;font-weight:400;letter-spacing:-.02em;text-shadow:0 1px 0 rgba(255,255,255,0.3)}
h2 sup{font-size:32px}
h2 small{font-size:56px}
h3{font-weight:400;font-size:28px;margin-bottom:30px;color:#555;text-shadow:0 1px 0 rgba(255,255,255,0.3);text-transform:uppercase}
ul{width:510px;margin:0 auto;padding:10px 0}
ul li{display:inline-block;text-align:center;background-repeat:no-repeat;width:122.25px;height:0;box-shadow:0 0 3px #333;color:#555;text-shadow:0 1px 0 rgba(255,255,255,0.3);font-size:22px;white-space:pre-line;margin:0 2.5px;padding:130px 0 0}
.wrapper{width:505px;height:505px;margin:140px auto}
.yeller{width:505px;height:505px;background-color:#F0DB4F;position:absolute;cursor:pointer}
.goodperspective .yeller{background-color:transparent}
#txjs-logo{-webkit-perspective:505px;width:505px;height:505px}
.white{position:absolute;background-color:#FFF;width:505px;height:505px}
.star-wrap{left:27px;top:154px;position:absolute}
.star{display:block;color:#FFF;width:0;height:0;border-right:100px solid transparent;border-bottom:73px solid #FFF;border-left:102px solid transparent;-moz-transform:rotate(36deg) scale(0.85,0.85);-webkit-transform:rotate(36deg) scale(0.85,0.85);-ms-transform:rotate(36deg) scale(0.85,0.85);-o-transform:rotate(36deg) scale(0.85,0.85);transform:rotate(36deg) scale(0.85,0.85);margin:60px auto}
.star:before{border-bottom:91px solid #FFF;border-left:30px solid transparent;border-right:30px solid transparent;position:absolute;height:0;width:0;top:-54px;left:-66px;display:block;content:'';-moz-transform:rotate(-35deg);-webkit-transform:rotate(-35deg);-ms-transform:rotate(-35deg);-o-transform:rotate(-35deg);transform:rotate(-35deg)}
.star:after{position:absolute;display:block;color:#FFF;top:2px;left:-106px;width:0;height:0;border-right:103px solid transparent;border-bottom:74px solid #FFF;border-left:100px solid transparent;-moz-transform:rotate(-72deg);-webkit-transform:rotate(-72deg);-ms-transform:rotate(-72deg);-o-transform:rotate(-72deg);transform:rotate(-72deg);content:''}
.blue{background-color:#3E407E;position:absolute;top:0;width:252.5px;left:0;height:505px}
.red{position:absolute;background-color:#D83C49;height:252.5px;top:252.5px;width:505px}
.js{position:absolute;bottom:-61px;right:30px;font-family:js, helvetica, arial;font-size:342px;color:#FFF;letter-spacing:-2px}
.badatfonts .js{font-weight:700;font-size:335px;bottom:-51px;letter-spacing:-30px}
.goodperspective .js{text-shadow:0 0 4px #000, 0 0 4px #000, 0 0 4px #000, 0 0 4px #000, 0 0 4px #000, 0 0 4px #000, 0 0 4px #000, 0 0 4px #000, 0 0 4px #000, 0 0 4px #000}
#txjs-logo *{-webkit-transition:all .2s linear;-webkit-perspective:505px;-moz-transition:all .3s linear;-ms-transition:all .3s linear;-o-transition:all .3s linear;transition:all .3s linear}
#txjs-logo.fancy{-webkit-transition:all .25s linear;-webkit-transform:rotateX(-20deg) translateX(100px)}
#txjs-logo.fancy .js{z-index:18;-webkit-transform:rotateY(70deg) translateX(30px);-moz-transform:scale(1.05);-ms-transform:scale(1.05);-o-transform:scale(1.05);transform:scale(1.05)}
.caution #txjs-logo.fancy .js{text-shadow:none}
.goodperspective #txjs-logo.fancy .js{text-shadow:0 0 4px #000, 0 0 4px #000, 0 0 4px #000, 0 0 4px #000, 0 0 4px #000, 0 0 4px #000, 0 0 4px #000, 0 0 4px #000, 0 0 4px #000, 0 0 4px #000, -4px 2px 4px rgba(0,0,0,0.3)}
#txjs-logo:hover .star-wrap{-webkit-transform:scale(1.2);-moz-transform:scale(1.2);-ms-transform:scale(1.2);-o-transform:scale(1.2);transform:scale(1.2)}
#txjs-logo.fancy .star-wrap{z-index:16;-webkit-transform:rotateY(70deg) translateX(222px) scale(1.9);-moz-transform:scale(0) translateX(-20px) translateY(-40px);-ms-transform:scale(0) translateX(-20px) translateY(-40px);-o-transform:scale(0) translateX(-20px) translateY(-40px);transform:scale(0) translateX(-20px) translateY(-40px)}
#txjs-logo.fancy .blue{z-index:14;-webkit-transform:rotateY(70deg) translateX(100px) scale(1.4);-moz-transform:translateX(-2000px);-ms-transform:translateX(-2000px);-o-transform:translateX(-2000px);transform:translateX(-2000px)}
#txjs-logo.fancy .red{z-index:12;-webkit-transform:rotateY(70deg) translateX(0) translateY(10px) translateZ(-119px) scale(1);-moz-transform:translateY(-2000px);-ms-transform:translateY(-2000px);-o-transform:translateY(-2000px);transform:translateY(-2000px)}
#txjs-logo.fancy .white{z-index:10;-webkit-transform:rotateY(70deg) translateX(-100px) translateZ(-120px) scale(0.8);-moz-transform:translateX(2000px);-ms-transform:translateX(2000px);-o-transform:translateX(2000px);transform:translateX(2000px)}
.goodperspective #txjs-logo.fancy .blue,.goodperspective #txjs-logo.fancy .red,.goodperspective #txjs-logo.fancy .white{box-shadow:-4px 2px 4px rgba(0,0,0,0.3)}
a{border:1px solid #333;background-color:#3E407E;display:block;text-decoration:none;color:#FFF;width:205px;font-size:20px;border-radius:5px;text-align:center;text-shadow:1px 1px 0 rgba(255,255,255,0.3);text-transform:uppercase;-webkit-transform:translateY(80px);margin:30px auto;padding:20px}
html{padding-bottom:100px;}  </style>
